import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';
import { supabase } from './supabaseClient'; 

// Pages
import HomePage from './pages/HomePage';
import AdminDashboard from './pages/AdminDashboard';
import SuccessPage from './pages/SuccessPage'; 
import LoginPage from './pages/LoginPage';
import AuthPage from './pages/a'; 
import ProfilePage from './pages/ProfilePage'; // Added for User History

// Components
import Navbar from './components/Navbar';
import CheckoutModal from './components/CheckoutModal';

function App() {
  const [cartCount, setCartCount] = useState(0);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [isAdmin, setIsAdmin] = useState(false); // Admin Dashboard State
  const [user, setUser] = useState(null); // Customer Account State

  // 1. Monitor User Authentication (Customer Login/Logout)
  useEffect(() => {
    // Check for existing session
    supabase.auth.getSession().then(({ data: { session } }) => {
      setUser(session?.user ?? null);
    });

    // Listen for changes (Login, Signup, Signout)
    const { data: { subscription } } = supabase.auth.onAuthStateChange((_event, session) => {
      setUser(session?.user ?? null);
    });

    return () => subscription.unsubscribe();
  }, []);

  // 2. Customer Logout Logic
  const handleUserLogout = async () => {
    await supabase.auth.signOut();
    alert("Logged out successfully");
  };

  const addToCart = () => setCartCount(prev => prev + 1);

  return (
    <Router>
      <div className="App" style={{ minHeight: '100vh', display: 'flex', flexDirection: 'column' }}>
        
        {/* Hidden Top Bar (Shows context for the presentation) */}
        <div style={{ 
          backgroundColor: '#212121', 
          color: 'white', 
          padding: '8px 50px', 
          fontSize: '11px', 
          display: 'flex', 
          justifyContent: 'space-between',
          alignItems: 'center'
        }}>
          <Link to="/" style={{ color: 'white', textDecoration: 'none', opacity: 0.8 }}>
            MEGAMART RWANDA - OFFICIAL STORE
          </Link>
          
          {user && (
            <div style={{ display: 'flex', gap: '15px', alignItems: 'center' }}>
              <span style={{ opacity: 0.8 }}>Logged in as: <strong>{user.email}</strong></span>
              <button 
                onClick={handleUserLogout} 
                style={{ background: 'none', border: 'none', color: '#FF4D4D', cursor: 'pointer', fontSize: '10px', fontWeight: 'bold' }}
              >
                LOGOUT
              </button>
            </div>
          )}
        </div>

        {/* 3. Main Navbar */}
        <Navbar 
          cartCount={cartCount} 
          openModal={() => setIsModalOpen(true)} 
          user={user} 
        />
        
        <main style={{ flex: 1 }}>
          <Routes>
            {/* Customer Store Routes */}
            <Route path="/" element={<HomePage addToCart={addToCart} />} />
            <Route path="/login" element={<AuthPage />} />
            <Route path="/profile" element={<ProfilePage user={user} />} />
            <Route path="/success" element={<SuccessPage user={user} />} />

            {/* Admin Management Routes */}
            <Route path="/admin-login" element={<LoginPage setIsAdmin={setIsAdmin} />} />
            <Route 
              path="/admin" 
              element={isAdmin ? <AdminDashboard setIsAdmin={setIsAdmin} /> : <Navigate to="/admin-login" />} 
            />
          </Routes>
        </main>

        {/* 4. Checkout Modal (Pops up when Cart is clicked) */}
        {isModalOpen && (
          <CheckoutModal 
            cartCount={cartCount} 
            closeModal={() => setIsModalOpen(false)} 
            user={user} 
          />
        )}

        {/* Footer */}
        <footer style={{ backgroundColor: '#fff', padding: '20px', textAlign: 'center', borderTop: '1px solid #eee' }}>
          <p style={{ fontSize: '12px', color: '#888' }}>Â© 2025 MegaMart Rwanda. All Rights Reserved.</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
